[SingapoRediscovers Winners Announcement] Thanks to everyone who has taken the time to explore “hidden gems” around Singapore over the past 3 weeks!
 
We have received many amazing photo submissions and it’s time to announce the contest winners!
 
Congratulations to…
 
@clarencesees for winning the 1st Prize – a One Night Stay at Marina Bay Sands (worth over SGD $339)
@elfintanned for winning the 2nd Prize – a One Night Stay at Mandarin Orchard Singapore (worth over SGD $280)
@mauvxx for winning the 3rd Prize – 2 Tickets to Universal Studios Singapore (worth up to SGD $162)
@whatdavidsnaps, @r_hugs, @dream_to_travel_it and @vincentphotogram for each winning a ticket to #InstaWalk Bugis, Waterloo and Kampong Gelam Tribe Tours (worth $55 per ticket)
@seanjunhao, @yean_to_travel and @adreechan for each winning a ticket to Trick Eye Museum Singapore (worth up to $25 per ticket)
 
Winners, we will be reaching out to you over DM to facilitate the claiming of prizes.
 
Thanks again for participating! We hope you had fun rediscovering Singapore. You can check out more deals on staycations, dining, and experiences around Singapore with the link in our bio!
 
#SingapoRediscovers #SPCRediscovers

