@singaporeair has dropped the idea of “flights to nowhere” – and is now inviting you to exclusive tours of the airline’s training facilities, as well as to dine onboard their A380 jumbo jets! ✈️

You can even try operating a full flight simulator, attend a grooming workshop and taste some of the premium in-flight wine labels. 

Kids can enjoy craft activities such as making their own batik roses, role play as cabin crew, and take home their very own SIA sarong kebaya uniform. #linkinbio

// Singapore currently celebrates the Mid-Autumn Festival – a holiday that brings families and friends together to watch the moon and celebrate the end of autumn harvest. All over Singapore you’ll find colorful lanterns and lampions that illuminate the red dot and make us aware of the special time. Head over to my blog to see some pictures of Singapore’s lightful decorations, you’ll find the link in my bio.

Happy Mid-Autumn Festival and enjoy your moon cake! 🌕

// In Singapur wird aktuell das Mid-Autumn Festival (Mondfest) gefeiert. Ein Feiertag, an dem Familien und Freunde zusammenkommen, um den Mond zu beobachten und das Ende der Herbsternte zu feiern. Traditionell findet man deshalb überall in Singapur bunte Laternen und Lampions, die den kleinen Stadtstaat erhellen und die besondere Zeit unterstreichen. Auf meinem Blog habe ich ein bisschen was zum Hintergrund der Festlichkeiten geschrieben und Fotos von Singapurs schönsten Lampions geteilt Schaut doch mal vorbei – Den Link findet ihr wie immer in der Bio. 🌕

