For my entire time living full time in Singapore, I had no idea that this place existed, so it was cool to see something I haven’t seen before. The building is rainbow colored and super bright that it can make you even forget it’s a rainy day. It’s located in Little India, which is a treat itself.

Built in 1900, the former house of Tan Teng Niah is the last surviving Chinese villa in Little India.

@javan Leaving a trail of light... View of the colourful Old Hill Street Police Station at rush hour.

Shot on Nikon Z7 + NIKKOR Z 24-200mm f/4-6.3 VR lens.

